import { useState } from "react";

const Home = () => {

    const [blogs, setBlogs] = useState([
        { title: "t1", body: "b1", author: "a1", id: 1 },
        { title: "t2", body: "b2", author: "a2", id: 2 },
        { title: "t3", body: "b3", author: "a3", id: 3 }
    ])    

    return (
        <div className="home">
            {blogs.map((blog) => (
                <div className="blog-preview" key={blog.id}>
                <h2>{ blog.title }</h2>
                <p>Written by { blog.author }</p>
                </div>
            ))}
        </div>
    );
}
 
export default Home;
